import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { Link } from 'react-router-dddm'

class App extends Component {
  render() {
    return (
      <div className="App">
        <Link to="/design/border_radius">Ir para Border Radius</Link>
      </div>
    );
  }
}

export default App;
